import React, { useState, useEffect } from "react";
import axios from "axios";

const YouTube = () => {
  const [channelData, setChannelData] = useState(null);
  const [videos, setVideos] = useState([]);
  const [shorts, setShorts] = useState([]);
  const [loading, setLoading] = useState(true);
  const [nextPageToken, setNextPageToken] = useState("");
  const [prevPageToken, setPrevPageToken] = useState("");
  const [pageToken, setPageToken] = useState(""); // For pagination

  const API_KEY = "YOUR_YOUTUBE_API_KEY"; // Replace with your API key
  const CHANNEL_ID = "UCSqX6nd5ITl3b9oFGpDPA"; // Replace with your channel ID
  const VIDEOS_PER_PAGE = 12; // Number of videos per page

  // Fetch channel data
  useEffect(() => {
    const fetchChannelData = async () => {
      try {
        const response = await axios.get(
          `https://www.googleapis.com/youtube/v3/channels?part=snippet,statistics&id=${CHANNEL_ID}&key=${API_KEY}`
        );
        const data = response.data.items[0];
        setChannelData(data);
      } catch (error) {
        console.error("Error fetching channel data:", error);
      }
    };
    fetchChannelData();
  }, []);

  // Fetch all videos and Shorts
  useEffect(() => {
    const fetchVideos = async () => {
      setLoading(true);
      try {
        const videoResponse = await axios.get(
          `https://www.googleapis.com/youtube/v3/search?part=snippet&channelId=${CHANNEL_ID}&maxResults=${VIDEOS_PER_PAGE}&pageToken=${pageToken}&key=${API_KEY}`
        );

        const allVideos = videoResponse.data.items;
        const filteredVideos = allVideos.filter(
          (video) => video.snippet.title.toLowerCase().includes("short") === false
        );
        const filteredShorts = allVideos.filter((video) =>
          video.snippet.title.toLowerCase().includes("short")
        );

        setVideos(filteredVideos);
        setShorts(filteredShorts);
        setNextPageToken(videoResponse.data.nextPageToken || "");
        setPrevPageToken(videoResponse.data.prevPageToken || "");
        setLoading(false);
      } catch (error) {
        console.error("Error fetching videos:", error);
        setLoading(false);
      }
    };
    fetchVideos();
  }, [pageToken]);

  // Handle pagination
  const handleNextPage = () => {
    if (nextPageToken) setPageToken(nextPageToken);
  };

  const handlePrevPage = () => {
    if (prevPageToken) setPageToken(prevPageToken);
    else setPageToken(""); // Reset to first page
  };

  return (
    <div className="space-y-6">
      <h1 className="text-3xl font-bold mb-4">YouTube - @chiranjeevikumar1008</h1>

      {/* Channel Info */}
      {channelData && (
        <div className="bg-gray-100 p-6 rounded-lg shadow">
          <h2 className="text-2xl font-semibold">{channelData.snippet.title}</h2>
          <p className="text-gray-700">
            Subscribers: <span className="font-bold">{channelData.statistics.subscriberCount}</span>
          </p>
          <a
            href={`https://youtube.com/@chiranjeevikumar1008`}
            target="_blank"
            rel="noopener noreferrer"
            className="text-blue-600 hover:underline mt-2 inline-block"
          >
            Visit Channel
          </a>
        </div>
      )}

      {/* Loading */}
      {loading ? (
        <p className="text-gray-500">Loading channel data...</p>
      ) : (
        <>
          {/* Videos Section */}
          <h2 className="text-2xl font-semibold mt-6">Videos</h2>
          <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-6">
            {videos.length > 0 ? (
              videos.map((video) => (
                <div key={video.id.videoId} className="space-y-2">
                  <iframe
                    src={`https://www.youtube.com/embed/${video.id.videoId}`}
                    title={video.snippet.title}
                    allowFullScreen
                    className="w-full h-48 rounded-lg"
                  />
                  <p className="text-sm font-medium truncate">{video.snippet.title}</p>
                </div>
              ))
            ) : (
              <p className="text-gray-500">No videos found.</p>
            )}
          </div>

          {/* Shorts Section */}
          <h2 className="text-2xl font-semibold mt-6">Shorts</h2>
          <div className="grid grid-cols-2 md:grid-cols-3 lg:grid-cols-4 gap-6">
            {shorts.length > 0 ? (
              shorts.map((short) => (
                <div key={short.id.videoId} className="space-y-2">
                  <iframe
                    src={`https://www.youtube.com/embed/${short.id.videoId}`}
                    title={short.snippet.title}
                    allowFullScreen
                    className="w-full h-48 rounded-lg"
                  />
                  <p className="text-sm font-medium truncate">{short.snippet.title}</p>
                </div>
              ))
            ) : (
              <p className="text-gray-500">No Shorts found.</p>
            )}
          </div>

          {/* Pagination Controls */}
          <div className="flex justify-between mt-6">
            <button
              onClick={handlePrevPage}
              disabled={!prevPageToken && pageToken === ""}
              className="px-4 py-2 bg-gray-900 text-white rounded-lg disabled:bg-gray-400 disabled:cursor-not-allowed"
            >
              Previous
            </button>
            <button
              onClick={handleNextPage}
              disabled={!nextPageToken}
              className="px-4 py-2 bg-gray-900 text-white rounded-lg disabled:bg-gray-400 disabled:cursor-not-allowed"
            >
              Next
            </button>
          </div>
        </>
      )}
    </div>
  );
};

export default YouTube;
